import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import api from '../../services/api';
import '../dashboard/Dashboard.css';

const ReportList = ({ userId, filter = 'all' }) => {
  const [reports, setReports] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchReports = async () => {
      try {
        let url = '/reports';
        if (userId) {
          url += `?userId=${userId}`;
        }
        if (filter !== 'all') {
          url += userId ? `&status=${filter}` : `?status=${filter}`;
        }

        const response = await api.get(url);
        setReports(response.data);
      } catch (error) {
        console.error('Failed to fetch reports:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchReports();
  }, [userId, filter]);

  const getStatusColor = (status) => {
    switch (status) {
      case 'pending':
        return { bg: '#FFF3CD', text: '#856404' };
      case 'in-progress':
        return { bg: '#DBEAFE', text: '#1E40AF' };
      case 'resolved':
        return { bg: '#D1FAE5', text: '#065F46' };
      default:
        return { bg: '#F3F4F6', text: '#374151' };
    }
  };

  const formatDate = (dateString) => {
    const options = { year: 'numeric', month: 'short', day: 'numeric' };
    return new Date(dateString).toLocaleDateString(undefined, options);
  };

  if (loading) {
    return (
      <div className="d-flex justify-content-center p-4">
        <div className="spinner-border text-primary" role="status">
          <span className="visually-hidden">Loading...</span>
        </div>
      </div>
    );
  }

  if (reports.length === 0) {
    return (
      <div className="empty-state">
        <i className="fas fa-clipboard"></i>
        <h3>No reports found</h3>
        <p>
          {filter === 'all' 
            ? "You haven't submitted any reports yet. Start by reporting a new issue." 
            : `You don't have any ${filter} reports.`
          }
        </p>
        <Link to="/report-form" className="btn-primary">
          <i className="fas fa-plus me-2"></i>
          Report New Issue
        </Link>
      </div>
    );
  }

  return (
    <div className="reports-list">
      {reports.map(report => (
        <div key={report._id} className="report-card">
          <div className="report-header">
            <div className="report-title">
              <h3>{report.title}</h3>
              <span 
                className="status-badge" 
                style={{
                  backgroundColor: getStatusColor(report.status).bg,
                  color: getStatusColor(report.status).text
                }}
              >
                {report.status.replace('-', ' ')}
              </span>
            </div>
            <div className="report-date">
              {formatDate(report.createdAt)}
            </div>
          </div>
          <div className="report-body">
            <p className="report-description">
              {report.description.length > 150 
                ? `${report.description.substring(0, 150)}...` 
                : report.description
              }
            </p>
            <div className="report-meta">
              <div className="report-location">
                <i className="fas fa-map-marker-alt me-1"></i>
                {report.location}
              </div>
              <div className="report-category">
                <i className="fas fa-tag me-1"></i>
                {report.category}
              </div>
            </div>
          </div>
          <div className="report-footer">
            <Link to={`/reports/${report._id}`} className="view-details-btn">
              View Details
              <i className="fas fa-arrow-right ms-1"></i>
            </Link>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ReportList;
